tables.table_schema:
CREATE TABLE wind_turbine_performance_data (
    turbine_id SERIAL PRIMARY KEY,
    date DATE,
    wind_speed_mph DECIMAL,
    power_output_kW DECIMAL
);

CREATE TABLE wind_turbine_performance_data (
    turbine_id SERIAL PRIMARY KEY,
    location VARCHAR(255),
    wind_speed FLOAT,
    power_generated FLOAT
);

CREATE TABLE maintenance_logs (
    log_id SERIAL PRIMARY KEY,
    turbine_id INT,
    maintenance_date DATE,
    maintenance_details TEXT
);
